INSERT INTO posts VALUES('8','দুস্থ খেলোয়াড়দের সহায়তায় প্রবাসীদের এগিয়ে আসার আহ্বান','<p><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">যুক্তরাষ্ট্র সফররত বাংলাদেশ অ্যাথলেটিকস ফেডারেশনের সাধারণ সম্পাদক আবদুর রকিবের সঙ্গে নিউইয়র্কপ্রবাসী সাবেক ক্রীড়াবিদ ও ক্রীড়া সংগঠকদের মতবিনিময় অনুষ্ঠিত হয়েছে। সভায় তিনি দেশের দুস্থ খেলোয়াড়দের সহায়তায় প্রবাসীদের এগিয়ে আসার আহ্বান জানান। স্থানীয় সময় ২৫ আগস্ট সন্ধ্যায় জ্যাকসন হাইটসের একটি ক্যাফেতে এই মতবিনিময়ের আয়োজন করে বাংলাদেশ ক্রীড়া সংস্থা যুক্তরাষ্ট্র। অনুষ্ঠানে বক্তারা বাংলাদেশ অ্যাথলেটিকস ফেডারেশনের সাধারণ সম্পাদক নির্বাচিত হওয়ায় আবদুর রকিবকে শুভেচ্ছা জানিয়ে তাঁর সার্বিক সাফল্য কামনা করেন। বক্তারা বলেন</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">, </span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">বহুমুখী প্রতিভার অধিকারী আবদুর রকিব দায়িত্ব নেওয়ার পর থেকে দৃশ্যমান পরিবর্তন লক্ষ্য করা যাচ্ছে অ্যাথলেটে। সভায় বক্তারা প্রবাস থেকে খেলোয়াড়দের দেশের ক্রীড়া প্রতিযোগিতায় অংশ গ্রহণের সুযোগ দেওয়ারও আহ্বান জানান।</span><br></p>','','facebook','https://www.facebook.com/watch/?v=338784757312497','দুস্থ-খেলোয়াড়দের-সহায়তায়-প্রবাসীদের-এগিয়ে-আসার-আহ্বান-1598699424','{\"orginal\":\"orginal-1598699424321548488.jpg\",\"small\":\"small-1598699424321548488.jpg\",\"medium\":\"medium-1598699424321548488.jpg\",\"large\":\"large-1598699424321548488.jpg\"}','1','1','','','','','1','2020-08-29 21:10:24','2020-08-30 16:34:32');
INSERT INTO posts VALUES('9','ওজোন পার্কে বারী হোম কেয়ারের শাখা উদ্বোধন ১ সেপ্টেম্বর','<p><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">নিউইয়র্কের ওজোন পার্কে আগামী ১ সেপ্টেম্বর বারী হোম কেয়ারের পঞ্চম শাখার উদ্বোধন হবে। ব্রুকলিন ও ওজোন পার্কের গ্রাহকদের সুবিধার্থে ১ সেপ্টেম্বর থেকে বারী হোম কেয়ারের ওজোন পার্ক কার্যালয়ে ৩৩</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">১০১ অ্যাভিনিউ</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">ব্রুকলিন</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">নিউ ইয়র্ক-১১২০৮ এই ঠিকানায় হোম কেয়ার সংশ্লিষ্ট সেবা প্রদান করা হবে। নিউইয়র্কে হোম কেয়ার সার্ভিসের জন্য অন্যতম নির্ভরযোগ্য প্রতিষ্ঠান বারী হোম কেয়ার দীর্ঘ দিন ধরে কমিউনিটিতে অসুস্থ</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">শারীরিকভাবে চলাফেরায় অক্ষম ও প্রবীণদের সেবা দিয়ে আসছে নিষ্ঠা এবং দক্ষতার সঙ্গে। প্রতিষ্ঠানটি রাজ্যের আইন মেনে সহজ পদ্ধতিতে হোম কেয়ার সার্ভিস দিয়ে থাকে এবং ঘরে বসে উপার্জনে সহায়তা করে। নিউইয়র্কের জ্যাকসন হাইটস</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">জ্যামাইকা</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">ব্রঙ্কস ও লং আইল্যান্ডে বারী হোম কেয়ারের সব শাখা দীর্ঘ লকডাউন শেষে পুরোদমে চালু হয়েছে।</span><br></p>','','','https://www.facebook.com/FM786Official/videos/628554274747230/','ওজোন-পার্কে-বারী-হোম-কেয়ারের-শাখা-উদ্বোধন-১-সেপ্টেম্বর-1598699715','{\"orginal\":\"orginal-15986997151176554175.jpg\",\"small\":\"small-15986997151176554175.jpg\",\"medium\":\"medium-15986997151176554175.jpg\",\"large\":\"large-15986997151176554175.jpg\"}','1','','','','','','1','2020-08-29 21:15:15','2020-08-29 21:15:15');
INSERT INTO posts VALUES('10','দারুল কিরাত কোর্সের ফল প্রকাশ ও পুরস্কার বিতরণী','<p><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">নিউইয়র্কের জ্যাকসন হাইটসে আগুনে পুড়ে যাওয়া বাংলাদেশি মালিকানাধীন গ্রোসারি&nbsp;</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">‘</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">খামার বাড়ি</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">’&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">আবার চালু হয়েছে। ২১ আগস্ট এক অনাড়ম্বর অনুষ্ঠানের মধ্য দিয়ে প্রতিষ্ঠানটি আবার খুলে দেওয়া হয়। করোনাভাইরাস প্রতিরোধে লকডাউনের কারণে প্রায় ছয় মাস নিউইয়র্কের সবকিছু বন্ধ থাকার পর আবার চাঞ্চল্য ফিরে আসছে। খাবার বাড়ি আবার চালু হওয়ায় কমিউনিটির সবাইকে স্বাগত জানিয়েছেন প্রতিষ্ঠানটির কর্ণধার মোহাম্মদ কামরুল।</span><br></p>','','','https://www.facebook.com/FM786Official/videos/328653348187779/','দারুল-কিরাত-কোর্সের-ফল-প্রকাশ-ও-পুরস্কার-বিতরণী-1598699799','{\"orginal\":\"orginal-1598699799381139941.jpg\",\"small\":\"small-1598699799381139941.jpg\",\"medium\":\"medium-1598699799381139941.jpg\",\"large\":\"large-1598699799381139941.jpg\"}','1','','','','','','1','2020-08-29 21:16:40','2020-08-29 21:16:40');
INSERT INTO posts VALUES('11','জ্যাকসন হাইটসে ‘খামার বাড়ি’ আবার চালু','<p><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">নিউইয়র্কের জ্যাকসন হাইটসে আগুনে পুড়ে যাওয়া বাংলাদেশি মালিকানাধীন গ্রোসারি&nbsp;</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">‘</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">খামার বাড়ি</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">’&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">আবার চালু হয়েছে। ২১ আগস্ট এক অনাড়ম্বর অনুষ্ঠানের মধ্য দিয়ে প্রতিষ্ঠানটি আবার খুলে দেওয়া হয়। করোনাভাইরাস প্রতিরোধে লকডাউনের কারণে প্রায় ছয় মাস নিউইয়র্কের সবকিছু বন্ধ থাকার পর আবার চাঞ্চল্য ফিরে আসছে। খাবার বাড়ি আবার চালু হওয়ায় কমিউনিটির সবাইকে স্বাগত জানিয়েছেন প্রতিষ্ঠানটির কর্ণধার মোহাম্মদ কামরুল।</span><br></p>','','','https://www.facebook.com/FM786Official/videos/3574666949219190/','জ্যাকসন-হাইটসে-‘খামার-বাড়ি’-আবার-চালু-1598699914','{\"orginal\":\"orginal-15986999141985118332.jpg\",\"small\":\"small-15986999141985118332.jpg\",\"medium\":\"medium-15986999141985118332.jpg\",\"large\":\"large-15986999141985118332.jpg\"}','1','','','','','','1','2020-08-29 21:18:34','2020-08-29 21:18:34');
INSERT INTO posts VALUES('12','শমশেরনগর হাসপাতাল বাস্তবায়নে মতবিনিময়','<p><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">শমশেরনগর হাসপাতাল বাস্তবায়নের লক্ষ্যে যুক্তরাষ্ট্রে অবস্থানরত শমশেরনগরবাসীদের মতবিনিময় সভা অনুষ্ঠিত হয়েছে। ২৫ আগস্ট নিউইয়র্কে ইউএস-বাংলা অনলাইন প্রেসক্লাব কার্যালয়ে এই সভা অনুষ্ঠিত হয়। মিজানুর রহমান চৌধুরীর সঞ্চালনায় সভায় সভাপতিত্ব করেন সুজা মেমোরিয়াল কলেজ শমশেরনগর প্রতিষ্ঠার অন্যতম উদ্যোক্তা ও প্রতিষ্ঠাকালীন অধ্যক্ষ সাইফুর রহমান। প্রথমে পরিচয় পর্বের মাধ্যমে সভার সূচনা হয়।</span><br></p>','','','https://www.facebook.com/FM786Official/videos/1249144668763470/','শমশেরনগর-হাসপাতাল-বাস্তবায়নে-মতবিনিময়-1598700035','{\"orginal\":\"orginal-15987000351112542316.jpg\",\"small\":\"small-15987000351112542316.jpg\",\"medium\":\"medium-15987000351112542316.jpg\",\"large\":\"large-15987000351112542316.jpg\"}','1','','','','','','1','2020-08-29 21:20:35','2020-08-29 21:20:35');
INSERT INTO posts VALUES('13','স্ট্যাটেন আইল্যান্ডে বিপুল আগ্নেয়াস্ত্রসহ দম্পতি গ্রেপ্তার','<p class=\"MsoNormal\" style=\"margin: 0in 0in 10pt; color: rgb(34, 34, 34); text-align: justify; line-height: 16.8667px; font-size: 11pt; font-family: Calibri, sans-serif;\"><span style=\"font-size: 14pt; line-height: 21.4667px; font-family: Kalpurush;\"><span lang=\"BN\">নিউইয়র্ক পুলিশ (এনওয়াইপিডি) স্ট্যাটেন আইল্যান্ডের টম্পকিন্সভিলের একটি বাড়ি থেকে অ্যাসল্ট রাইফেল ও বিপুলসংখ্যক গোলাবারুদসহ ৩৮ বছর বয়সী জোনাথন ও ইয়ালিৎজা গঞ্জালেজ নামের এক দম্পতিকে গ্রেপ্তার করেছে। নিউইয়র্ক পুলিশের ডেপুটি কমিশনার জানান</span>,&nbsp;<span lang=\"BN\">তদন্তের অংশ হিসেবে পুলিশ ওয়েস্টারভেন্ট অ্যাভিনিউয়ের ৪০০ ব্লকের একটি বাড়িতে সার্চ ওয়ারেন্ট কার্যকর করেছিল। সেখান থেকে তারা একটি এআর ফিফটিন অ্যাসল্ট রাইফেল</span>,&nbsp;<span lang=\"BN\">একটি নাইন এমএম পিস্তল</span>,&nbsp;<span lang=\"BN\">একটি ব্যালিস্টিক ভেস্ট</span>,&nbsp;<span lang=\"BN\">৪০০ রাউন্ডের বেশি গোলাবারুদ ও পিস্তল তৈরির যন্ত্রাংশ উদ্ধার করেছে। পাওয়া গেছে গাঁজাও।</span></span></p>','কমিউনিটি সংবাদ','','https://www.facebook.com/FM786Official/videos/348360969679427/','স্ট্যাটেন-আইল্যান্ডে-বিপুল-আগ্নেয়াস্ত্রসহ-দম্পতি-গ্রেপ্তার-1598700120','{\"orginal\":\"orginal-15987001201373206791.jpg\",\"small\":\"small-15987001201373206791.jpg\",\"medium\":\"medium-15987001201373206791.jpg\",\"large\":\"large-15987001201373206791.jpg\"}','1','','','','','','1','2020-08-29 21:22:01','2020-08-29 21:22:01');
INSERT INTO posts VALUES('14','নিউইয়র্কের সব স্কুল খুলছে ৭ সেপ্টেম্বর','<p><span lang=\"BN\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">আর মাত্র কয়েক দিন পরই নিউইয়র্কের স্কুলগুলো খুলছে। আগামী ৫ সেপ্টেম্বর থেকে স্কুল খোলার কথা থাকলেও ওই দিন শনিবার হওয়ায় স্কুল বন্ধ। ৬ সেপ্টেম্বরও বন্ধ। তাই ৭ সেপ্টেম্বর সোমবার থেকে নিউইয়র্কের স্কুলগুলো খুলবে। তবে ৭ সেপ্টেম্বর থেকে ক্লাস শুরু হবে</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">নাকি ১০ সেপ্টেম্বর থেকে</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">তা এখনো ঘোষণা করা হয়নি। শোনা যাচ্ছে</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">১০ সেপ্টেম্বর থেকে ক্লাস শুরু হতে পারে। স্কুল খোলার পর তিন দিন ইনপারসন ক্লাস হবে আর দুই দিন রিমোট লার্নিং দিয়েই স্কুল রিওপেনিংয়ের প্ল্যান রয়েছে। স্টেট গভর্নর অ্যান্ড্রু কুমো ও সিটি মেয়র বিল ডি ব্লাজিও এবং নিউইয়র্ক সিটি ডিপার্টমেন্ট অব এডুকেশনের চ্যান্সেলর রিচার্ড এ কারানজা জানিয়েছেন</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">স্কুল খোলার সব ধরনের প্রস্তুতি নেওয়া হচ্ছে।</span><br></p>','','','https://www.facebook.com/FM786Official/videos/738579576965723/','নিউইয়র্কের-সব-স্কুল-খুলছে-৭-সেপ্টেম্বর-1598700224','{\"orginal\":\"orginal-159870022495124710.jpg\",\"small\":\"small-159870022495124710.jpg\",\"medium\":\"medium-159870022495124710.jpg\",\"large\":\"large-159870022495124710.jpg\"}','1','','','','','','1','2020-08-29 21:23:44','2020-08-29 21:23:44');
INSERT INTO posts VALUES('15','নিউইয়র্ক বইমেলায় ‘মুক্তধারা সেরা বই’ পুরস্কারের জন্য ৫টি বই মনোনীত','<p><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">নিউইয়র্ক বাংলা বইমেলায় ২০১৯ সালে প্রকাশিত বই থেকে প্রাথমিক বাছাইয়ে ৫টি বই মনোনীত হয়েছে বলে আয়োজক মুক্তধারা ফাউন্ডেশন সূত্রে জানা গেছে। বইগুলো হলো: জীবন চৌধুরীর গ্রন্থ&nbsp;</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">‘</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">গান আর গানের মানুষ</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">’&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">প্রকাশক: মূর্ধন্য</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">সেলিম জাহানের গ্রন্থ&nbsp;</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">‘</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">স্বল্প কথার গল্প</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">’&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">প্রকাশক: প্রথমা</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">মুজিব ইরমের গ্রন্থ&nbsp;</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">‘</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">পাঠ্যপুস্তক</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">’&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">প্রকাশক: চৈতন্য</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">ফকির ইলয়াসের গ্রন্থ&nbsp;</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">‘</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">নক্ষত্র বিক্রির রাতে</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">’&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">প্রকাশক: য়ারোয়া বুক কর্নার</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">এবং স্মৃতি ভদ্রের গ্রন্থ&nbsp;</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">‘</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">অন্তর্গত নিষাদ ও পায়রা রঙের মেঘ</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">’,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">প্রকাশক: পেন্সিল পাবলিকেশন্স। বাছাইকৃত এই ৫টি বই থেকে&nbsp;</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">‘</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">সেরা বই</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">’-</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">এর চুড়ান্ত নির্বাচনের দায়িত্বে রয়েছেন বাংলাদেশের খ্যাতনামা লেখক ও বুদ্ধিজীবীদের একটি প্যানেল। মেলার পঞ্চম দিন</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">২২ সেপ্টেম্বর এই পুরষ্কার ঘোষণা করা হবে। মুক্তধারা ফাউন্ডেশন আয়োজিত ২৯-তম নিউইয়র্ক বাংলা বইমেলা বসছে সেপ্টেম্বরের ১৮ থেকে ২৭ তারিখ পর্যন্ত। করোনাভাইরাসের কারণে ১০ দিনব্যাপী এই মেলার পুরোটাই হবে অনলাইন বা ভার্চুয়াল। এবছরের মেলায় প্রথমবারের মত&nbsp;</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">‘</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">মুক্তধারা সেরা বই</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">’&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">পুরষ্কার চালু হচ্ছে। এই পুরষ্কার শুধুমাত্র বাংলাদেশ ও ভারতের বাইরে অবস্থানরত বাঙালি লেখকদের প্রকাশিত বইয়ের জন্য নির্ধারিত। পুরষ্কারের মূল্যমান ৫০০ মার্কিন ডলার। মুক্তধারা ফাউন্ডেশনের নিজস্ব তহবিল থেকে এই পুরষ্কার দেওয়া হবে।</span><br></p>','','','','নিউইয়র্ক-বইমেলায়-‘মুক্তধারা-সেরা-বই’-পুরস্কারের-জন্য-৫টি-বই-মনোনীত-1598722642','{\"orginal\":\"orginal-1598722642593234743.jpg\",\"small\":\"small-1598722642593234743.jpg\",\"medium\":\"medium-1598722642593234743.jpg\",\"large\":\"large-1598722642593234743.jpg\"}','1','','','','','','1','2020-08-30 03:37:22','2020-08-30 03:37:22');
INSERT INTO posts VALUES('16','পদত্যাগ করলেন জাপানের প্রধানমন্ত্রী অ্যাবে','<p><span lang=\"BN\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">জাপানের প্রধানমন্ত্রী শিনজো অ্যাবে স্বাস্থ্যজনিত কারণে পদত্যাগের ঘোষণা দিয়েছেন। আজ শুক্রবার (২৮ আগস্ট) দেশটির রাষ্ট্রীয় টেলিভিশন এবং তার দল ডেমোক্র্যাট পার্টি এলডিপিকে বিষয়টি নিশ্চিত করেছে। দ্রুত পদত্যাগ পত্র জমা দেবেন বলেও জানিয়েছেন অ্যাবে। খবরের সূত্রের নাম উল্লেখ না করে জাতীয় সম্প্রচার কেন্দ্র এনএইচকে পরিবেশিত খবরে বলা হয়</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">, </span><span lang=\"BN\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">অসুস্থতার কারণে তার শারীরিক অবস্থার অবনতি ঘটায় এবং এ কারণে দেশকে এগিয়ে নিতে তিনি সমস্যায় পড়বেন এমন চিন্তা থেকে অ্যাবে পদত্যাগের অভিপ্রায় ব্যক্ত করেছেন।</span><br></p>','','','','পদত্যাগ-করলেন-জাপানের-প্রধানমন্ত্রী-অ্যাবে-1598722745','{\"orginal\":\"orginal-15987227452024890433.jpg\",\"small\":\"small-15987227452024890433.jpg\",\"medium\":\"medium-15987227452024890433.jpg\",\"large\":\"large-15987227452024890433.jpg\"}','1','1','','','','','1','2020-08-30 03:39:05','2020-08-30 10:01:14');
INSERT INTO posts VALUES('19','কভিড ১৯ এর কারণে এবছর পিইসি-ইইসি পরীক্ষা হচ্ছে না।','<span style=\"font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">করোনার পরিস্থিতির কারনে এবার&nbsp; প্রাথমিক শিক্ষা সমাপনী (পিইসি) এবং ইবতেদায়ি শিক্ষা সমাপনী (ইইসি) পরীক্ষা হচ্ছে না। মঙ্গলবার (২৫ আগস্ট) প্রাথমিক ও গণশিক্ষা মন্ত্রণালয়ের পাঠানো এ সংক্রান্ত প্রস্তাবনায় প্রধানমন্ত্রী অনুমোদন দিয়েছেন। প্রাথমিক ও গণশিক্ষা মন্ত্রণালয়ের প্রতিমন্ত্রী জাকির হোসেন এই তথ্য জানিয়েছেন।</span>','','','','কভিড-১৯-এর-কারণে-এবছর-পিইসি-ইইসি-পরীক্ষা-হচ্ছে-না।-1598796290','{\"orginal\":\"orginal-15987962901708254698.jpg\",\"small\":\"small-15987962901708254698.jpg\",\"medium\":\"medium-15987962901708254698.jpg\",\"large\":\"large-15987962901708254698.jpg\"}','1','','','','','','1','2020-08-30 14:04:50','2020-08-30 14:04:50');
INSERT INTO posts VALUES('20','নেতানিয়াহুর সঙ্গে গোপন বৈঠক বাতিল করলেন সৌদি যুবরাজ','<p><span lang=\"BN-BD\" style=\"font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">ইসরায়েলের প্রধানমন্ত্রী বেনিয়ামিন নেতানিয়াহুর সঙ্গে ওয়াশিংটনে এক গোপন বৈঠক বাতিল করেছেন সৌদি যুবরাজ মোহাম্মদ বিন সালমান। মধ্যপ্রাচ্যবিষয়ক সংবাদমাধ্যম মিডলইস্ট আই এক প্রতিবেদনে জানিয়েছে</span><span style=\"font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">আগামী সপ্তাহে অনুষ্ঠিতব্য গোপন এই বৈঠক আয়োজনের খবর ফাঁস হয়ে গেলে এই সিদ্ধান্ত নেন সৌদি যুবরাজ।</span><br></p>','','','','নেতানিয়াহুর-সঙ্গে-গোপন-বৈঠক-বাতিল-করলেন-সৌদি-যুবরাজ-1598796380','{\"orginal\":\"orginal-15987963801147761437.jpg\",\"small\":\"small-15987963801147761437.jpg\",\"medium\":\"medium-15987963801147761437.jpg\",\"large\":\"large-15987963801147761437.jpg\"}','1','','','','','','1','2020-08-30 14:06:20','2020-08-30 14:06:20');
INSERT INTO posts VALUES('21','উগ্র দক্ষিণপন্থীদেরই ভরসা মানছেন ট্রাম্প','<p><span lang=\"BN-BD\" style=\"font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">মার্কিন নির্বাচন যতই ঘনিয়ে আসছে</span><span style=\"font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">প্রেসিডেন্ট ট্রাম্প ও রিপাবলিকানরা ততই আরও বেশি করে উগ্র দক্ষিণপন্থীদের সমর্থনের ওপরে নির্ভর করতে শুরু করেছে। অন্যদিকে ট্রাম্প রাষ্ট্রীয় ক্ষমতার অপব্যবহার করছেন এবং রাষ্ট্রীয় প্রতিষ্ঠানগুলোকে তাঁর নির্বাচনের কাজে ব্যবহার করছেন বলে অভিযোগ উঠছে। নির্বাচনে রাষ্ট্রীয় প্রতিষ্ঠান ব্যবহার কেবল নৈতিকতাবিরোধী নয়</span><span style=\"font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"font-family: Kalpurush; font-size: 18.6667px; text-align: justify;\">অনেক ক্ষেত্রেই দেশের প্রচলিত আইনবিরোধী।</span><br></p>','','','','উগ্র-দক্ষিণপন্থীদেরই-ভরসা-মানছেন-ট্রাম্প-1598796480','{\"orginal\":\"orginal-15987964801960266753.jpg\",\"small\":\"small-15987964801960266753.jpg\",\"medium\":\"medium-15987964801960266753.jpg\",\"large\":\"large-15987964801960266753.jpg\"}','1','','','','','','1','2020-08-30 14:08:00','2020-08-30 14:08:00');
INSERT INTO posts VALUES('22','সেপ্টেম্বরের শুরুতেও দর্শকহীন থাকছে বুন্দেসলিগা','<p><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; font-variant-ligatures: normal; orphans: 2; text-align: justify; widows: 2;\">বুন্দেসলিগার নতুন মৌসুম (২০২০-২০২১) শুরু হওয়ার কথা ১১ সেপ্টেম্বর থেকে। বেশ কিছুদিন ধরেই আলোচনা হচ্ছিল</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; font-variant-ligatures: normal; orphans: 2; text-align: justify; widows: 2;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; font-variant-ligatures: normal; orphans: 2; text-align: justify; widows: 2;\">নতুন মৌসুমে হয়তো অল্প করে হলেও দর্শক থাকবে মাঠে। কিন্তু করোনা পরিস্থিতি এখনও সন্তোষজনক না হওয়ায়</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; font-variant-ligatures: normal; orphans: 2; text-align: justify; widows: 2;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; font-variant-ligatures: normal; orphans: 2; text-align: justify; widows: 2;\">সেই পথে হাঁটবে না জার্মান ফুটবল অ্যাসোসিয়েশন। দেশটির সরকারের সঙ্গে আলোচনা শেষে অন্তত পক্ষে অক্টোবরের শেষ পর্যন্ত দর্শক ছাড়াই খেলা চালিয়ে নেওয়ার সিদ্ধান্ত তাদের।</span><br></p>','','','','সেপ্টেম্বরের-শুরুতেও-দর্শকহীন-থাকছে-বুন্দেসলিগা-1598803144','{\"orginal\":\"orginal-15988031441437816037.jpg\",\"small\":\"small-15988031441437816037.jpg\",\"medium\":\"medium-15988031441437816037.jpg\",\"large\":\"large-15988031441437816037.jpg\"}','1','','','','','','1','2020-08-30 15:59:04','2020-08-30 15:59:04');
INSERT INTO posts VALUES('23','করোনাকালে নিউইয়র্কে বিয়ের ধুম','<p><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; font-variant-ligatures: normal; orphans: 2; text-align: justify; widows: 2;\">করোনাভাইরাসে থমকে যাওয়া নিউইয়র্কে জীবনের স্বাভাবিক ছন্দ ফিরতে শুরু করেছে। গ্রীষ্ম শেষের সময়টিতে স্বদেশিদের মধ্যে বিয়ে আয়োজনের ধুম লেগেছে। প্রায় ছয় মাসের রুদ্ধাবস্থা থেকে লোকজন বেরিয়ে আসছে। প্রায় প্রতি দিনই বাংলাদেশিদের বিয়ের আয়োজন থাকছে। অনুষ্ঠান আয়োজনের জন্য এমনকি হল বুকিং পেতেও হিমশিম খেতে হচ্ছে। করোনা মহামারিতে যুক্তরাষ্ট্রে এক লাখের বেশি মানুষের মৃত্যু হয়েছে এ পর্যন্ত। বিশ্বের সবচেয়ে বেশি মৃত্যুর নগরী নিউইয়র্ক</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; font-variant-ligatures: normal; orphans: 2; text-align: justify; widows: 2;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; font-variant-ligatures: normal; orphans: 2; text-align: justify; widows: 2;\">যেখানে ২৫ হাজারের বেশি লোকের মৃত্যু হয়েছে করোনায়। নিউইয়র্কের জনসমাজে এমন কোনো পরিবার নেই</span><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; font-variant-ligatures: normal; orphans: 2; text-align: justify; widows: 2;\">,&nbsp;</span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; font-variant-ligatures: normal; orphans: 2; text-align: justify; widows: 2;\">যাদের কোনো স্বজন বা পরিচিতজনের মৃত্যু হয়নি এ মহামারিতে।</span><br></p>','','facebook','https://www.facebook.com/FM786Official/videos/776751819805471/','করোনাকালে-নিউইয়র্কে-বিয়ের-ধুম-1598803465','{\"orginal\":\"orginal-1598803465348504533.jpg\",\"small\":\"small-1598803465348504533.jpg\",\"medium\":\"medium-1598803465348504533.jpg\",\"large\":\"large-1598803465348504533.jpg\"}','1','','','','','','1','2020-08-30 16:04:25','2020-08-30 16:04:25');
INSERT INTO posts VALUES('25','সি আর দত্ত স্মরণে যুক্তরাষ্ট্র আ.লীগের শোকসভা','<p><span lang=\"BN\" style=\"color: rgb(34, 34, 34); font-variant-ligatures: normal; orphans: 2; text-align: justify; widows: 2; font-size: 14pt; line-height: 21.4667px; font-family: Kalpurush;\">মুক্তিযুদ্ধের সেক্টর কমান্ডার চিত্তরঞ্জন দত্ত (সি আর দত্ত) স্মরণে শোকসভা করেছে যুক্তরাষ্ট্র আওয়ামী লীগ। সভায় দলের নেতা-কর্মীসহ প্রবাসের গুরুত্বপূর্ণ ব্যক্তিরা উপস্থিত ছিলেন। ২৬ আগস্ট নিউইয়র্কের জ্যাকসন হাইটসের একুশের গলিতে এই শোকসভার আয়োজন করে যুক্তরাষ্ট্র আওয়ামী লীগ। অনুষ্ঠান সঞ্চালনা করেন যুক্তরাষ্ট্র আওয়ামী লীগের ভারপ্রাপ্ত সাধারণ সম্পাদক সামাদ আজাদ। সভায় যুক্তরাষ্ট্র আওয়ামী লীগের সভাপতি সিদ্দিকুর রহমানসহ অনেকেই উপস্থিত ছিলেন। সিদ্দিকুর রহমান বলেন</span><span style=\"color: rgb(34, 34, 34); font-variant-ligatures: normal; orphans: 2; text-align: justify; widows: 2; font-size: 14pt; line-height: 21.4667px; font-family: Kalpurush;\">,&nbsp;<span lang=\"BN\">প্রয়াত এই বীরের কাহিনি আমরা প্রায়শ শুনেছি। আজ তিনি আমাদের মাঝে নেই। আমাদের দায়িত্ব থেকেই আজকের এই স্মরণ সভার আয়োজন করেছি</span>,&nbsp;<span lang=\"BN\">যেন তাঁর আত্মা শান্তি পায়।</span></span><br></p>','','','','সি-আর-দত্ত-স্মরণে-যুক্তরাষ্ট্র-আ.লীগের-শোকসভা-1598804396','{\"orginal\":\"orginal-15988043962012373784.jpg\",\"small\":\"small-15988043962012373784.jpg\",\"medium\":\"medium-15988043962012373784.jpg\",\"large\":\"large-15988043962012373784.jpg\"}','1','','','','','','1','2020-08-30 16:19:57','2020-08-30 16:19:57');
INSERT INTO posts VALUES('26','রেস্টুরেন্টে বাসি খাবার পরিবেশনের অভিযোগ','<p><span lang=\"BN\" style=\"color: rgb(34, 34, 34); font-variant-ligatures: normal; orphans: 2; text-align: justify; widows: 2; font-size: 14pt; line-height: 21.4667px; font-family: Kalpurush;\">নিউইয়র্কের বিভিন্ন রেস্টুরেন্টে বাসি ও নিম্নমানের খাবার পরিবেশনের অভিযোগ উঠেছে। করোনাভাইরাস প্রতিরোধে লকডাউন শেষে নিউইয়র্ক নগরী আবার খুলেছে। এখনো নগরীর সব কার্যক্রমে স্বাভাবিকতা ফিরে আসেনি। তাই সংশ্লিষ্ট কর্তৃপক্ষের নিয়মিত পরিদর্শন না থাকায় এই ঘটনা ঘটছে বলে জানা গেছে। রেস্টুরেন্টে বাসি ও নিম্নমানের খাবার খেয়ে অনেকেই পেটের পীড়াসহ নানাবিধ রোগে ভুগছেন। এ ঘটনায় নগরীর কয়েকটি রেস্টুরেন্টের বিরুদ্ধে সংশ্লিষ্ট দপ্তরে অভিযোগ জানিয়েছেন গ্রাহকেরা। নগরীর বিভিন্ন রেস্টুরেন্ট ঘুরে দেখা গেছে</span><span style=\"color: rgb(34, 34, 34); font-variant-ligatures: normal; orphans: 2; text-align: justify; widows: 2; font-size: 14pt; line-height: 21.4667px; font-family: Kalpurush;\">,&nbsp;<span lang=\"BN\">রেস্টুরেন্টে পরিষ্কার পরিচ্ছন্নতার মান একেবারেই কমে গেছে। কিচেনের ভেতর অপরিচ্ছন্ন জায়গায় রান্নার কাজ চলছে। এমন অবহেলা বাংলাদেশিবহুল এলাকায় বেশি হচ্ছে। আগের তৈরি খাবার দিনের পর দিন গরম করে খাওয়ানো হচ্ছে বলে অভিযোগ জানিয়েছেন গ্রাহকেরা।</span></span><br></p>','','','','রেস্টুরেন্টে-বাসি-খাবার-পরিবেশনের-অভিযোগ-1598804486','{\"orginal\":\"orginal-15988044862088551237.jpg\",\"small\":\"small-15988044862088551237.jpg\",\"medium\":\"medium-15988044862088551237.jpg\",\"large\":\"large-15988044862088551237.jpg\"}','1','','','','','','1','2020-08-30 16:21:27','2020-08-30 16:21:27');
INSERT INTO posts VALUES('27','ইসরায়েল-আমিরাত ঐতিহাসিক বিমান চলাচল শুরু হচ্ছে সোমবার','<p><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; font-variant-ligatures: normal; orphans: 2; text-align: justify; widows: 2;\">সম্পর্ক স্বাভাবিকের চুক্তি করার পর এবার প্রথমবারের মতো ইসরায়েল এবং সংযুক্ত আরব আমিরাতের মধ্যে বিমানের বাণিজ্যিক ফ্লাইট শুরু হতে যাচ্ছে। আগামী সোমবার ইসরায়েল থেকে আমিরাতের উদ্দেশে ইএল এএল এয়ারলাইন্সের একটি বিমানের যাত্রা শুরুর মাধ্যমে আকাশপথে দুই দেশের মধ্যে আনুষ্ঠানিক যোগাযোগ শুরু হবে। শুক্রবার ইসরায়েলি বিমানসংস্থা ইএল এল এয়ারলাইন্সের একজন মুখপাত্রের বরাত দিয়ে এ তথ্য জানিয়েছে ব্রিটিশ বার্তাসংস্থা রয়টার্স।</span><br></p>','','','','ইসরায়েল-আমিরাত-ঐতিহাসিক-বিমান-চলাচল-শুরু-হচ্ছে-সোমবার-1598804529','{\"orginal\":\"orginal-1598804529786464442.jpg\",\"small\":\"small-1598804529786464442.jpg\",\"medium\":\"medium-1598804529786464442.jpg\",\"large\":\"large-1598804529786464442.jpg\"}','1','','','','','','1','2020-08-30 16:22:09','2020-08-30 16:22:09');
INSERT INTO posts VALUES('28','বুদ্ধিজীবী কবরস্থানে সমাহিত হলেন রাহাত খান','<p><span lang=\"BN\" style=\"color: rgb(34, 34, 34); font-variant-ligatures: normal; orphans: 2; text-align: justify; widows: 2; font-size: 14pt; line-height: 21.4667px; font-family: Kalpurush;\">একুশে পদকপ্রাপ্ত বিশিষ্ট কথাসাহিত্যিক ও সাংবাদিক রাহাত খানকে মিরপুর বুদ্ধিজীবী কবরস্থানে সমাহিত করা হয়েছে। শনিবার তাঁকে দাফন করা হয় সেখানে। রাহাত খানের স্ত্রী অপর্ণা খান বিষয়টি নিশ্চিত করেছেন। তিনি বলেন</span><span style=\"color: rgb(34, 34, 34); font-variant-ligatures: normal; orphans: 2; text-align: justify; widows: 2; font-size: 14pt; line-height: 21.4667px; font-family: Kalpurush;\">, \'<span lang=\"BN\">উনার (রাহাত খান) শেষ ইচ্ছা অনুযায়ী মিরপুর বুদ্ধিজীবী কবরস্থানে শনিবার (আজ) তাঁকে সমাহিত করা হয়। রাতে মরদেহ বারডেম হাসপাতালের হিমাগারে রাখা ছিল।</span>\'&nbsp;<span lang=\"BN\">গতকাল শুক্রবার রাত সাড়ে ৮টার দিকে রাজধানীর নিজ বাসায় শেষনিঃশ্বাস ত্যাগ করেন রাহাত খান। তাঁর বয়স হয়েছিল ৮০ বছর। তাঁর মৃত্যুতে রাষ্ট্রপতি মো. আবদুল হামিদ ও প্রধানমন্ত্রী শেখ হাসিনাসহ অনেক বিশিষ্টজন গভীর শোক প্রকাশ করেছেন।</span></span><br></p>','','','','বুদ্ধিজীবী-কবরস্থানে-সমাহিত-হলেন-রাহাত-খান-1598804571','{\"orginal\":\"orginal-1598804571420787865.jpg\",\"small\":\"small-1598804571420787865.jpg\",\"medium\":\"medium-1598804571420787865.jpg\",\"large\":\"large-1598804571420787865.jpg\"}','1','','','','','','1','2020-08-30 16:22:51','2020-08-30 16:22:51');
INSERT INTO posts VALUES('29','১ সেপ্টেম্বর থেকে আগের ভাড়ায় গণপরিবহন: ওবায়দুল কাদের','<p><span style=\"color: rgb(34, 34, 34); font-family: Kalpurush; font-size: 18.6667px; font-variant-ligatures: normal; orphans: 2; text-align: justify; widows: 2;\">আগামী ১ সেপ্টেম্বর থেকে আগের বাড়ায় গণপরিবহন চলবে বলে জানিয়েছেন আওয়ামী লীগের সাধারণ সম্পাদক এবং সড়ক পরিবহন ও সেতুমন্ত্রী ওবায়দুল কাদের। তবে এক্ষেত্রে আসনের অতিরিক্ত যাত্রী পরিবহন ও দাঁড়িয়ে যাত্রী নেওয়া যাবে না বলেও জানান তিনি। শনিবার (২৯ আগস্ট) ঢাকা জোনের বিআরটিএ ও বিআরটিসির কর্মকর্তাদের সঙ্গে এক মতবিনিময় সভায় সেতুমন্ত্রী এ তথ্য জানান। ওবায়দুল কাদের সংসদ ভবন এলাকায় তার সরকারি বাসভবন থেকে ভিডিও কনফারেন্সের মাধ্যমে এ সভায় যুক্ত হন।</span><br></p>','','','','১-সেপ্টেম্বর-থেকে-আগের-ভাড়ায়-গণপরিবহন:-ওবায়দুল-কাদের-1598804605','{\"orginal\":\"orginal-15988046051177029539.jpg\",\"small\":\"small-15988046051177029539.jpg\",\"medium\":\"medium-15988046051177029539.jpg\",\"large\":\"large-15988046051177029539.jpg\"}','1','','','','','','1','2020-08-30 16:23:25','2020-08-30 16:23:25');
INSERT INTO posts VALUES('30','রিপাবলিকান কনভেনশন যেন পারিবারিক ‘রিয়েলিটি শো’','<p><span style=\"color: rgb(34, 34, 34); font-variant-ligatures: normal; orphans: 2; text-align: justify; widows: 2; font-size: 14pt; line-height: 21.4667px; font-family: Kalpurush;\">‘<span lang=\"BN-BD\">এ বছর নভেম্বরের নির্বাচনে নির্ধারিত হবে আমরা আমেরিকার স্বপ্ন রক্ষা করতে সক্ষম হব</span>,&nbsp;<span lang=\"BN-BD\">নাকি একটি সমাজতান্ত্রিক অ্যাজেন্ডা গ্রহণ করব</span>,&nbsp;<span lang=\"BN-BD\">যার ফলে আমাদের কাঙ্ক্ষিত নিয়তি ভেঙে চুরমার হবে।</span>’&nbsp;<span lang=\"BN-BD\">যুক্তরাষ্ট্রের রিপাবলিকান পার্টির কনভেনশনের চতুর্থ দিন গত বৃহস্পতিবার হোয়াইট হাউস প্রাঙ্গণে প্রেসিডেন্ট ডোনাল্ড ট্রাম্প তাঁর প্রার্থীপদ গ্রহণ করে এ কথাগুলোই বলেন।</span></span><span lang=\"BN-BD\" style=\"color: rgb(34, 34, 34); font-variant-ligatures: normal; orphans: 2; text-align: justify; widows: 2; font-size: 14pt; line-height: 21.4667px; font-family: Kalpurush;\">&nbsp;</span><span lang=\"BN\" style=\"color: rgb(34, 34, 34); font-variant-ligatures: normal; orphans: 2; text-align: justify; widows: 2; font-size: 14pt; line-height: 21.4667px; font-family: Kalpurush;\">রিপাবলিকান কনভেনশন আংশিক ভার্চ্যুয়াল হলেও ডোনাল্ড ট্রাম্প ও ফার্স্ট লেডি মেলানিয়া ট্রাম্প দর্শকের উপস্থিতিতে হোয়াইট হাউস থেকেই ভাষণ দেন।&nbsp;</span><span style=\"color: rgb(34, 34, 34); font-variant-ligatures: normal; orphans: 2; text-align: justify; widows: 2; font-size: 14pt; line-height: 21.4667px; font-family: Kalpurush;\">‘<span lang=\"BN\">জনতার গৃহ</span>’&nbsp;<span lang=\"BN\">হিসেবে পরিচিত হোয়াইট হাউস এই প্রথম কোনো দলের রাজনৈতিক প্রয়োজনে ব্যবহৃত হলো। মার্কিন আইন অনুসারে এর ব্যবহার নিষিদ্ধ। মার্কিন সরকারের অফিস অব গভর্নমেন্ট এথিকসের সাবেক পরিচালক ওয়াল্টার শ্যব এই ব্যবহারকে&nbsp;</span>‘<span lang=\"BN\">ঘৃণিত একটি কাজ</span>’&nbsp;<span lang=\"BN\">বলে বর্ণনা করেছেন। তাঁর মতে</span>,&nbsp;<span lang=\"BN\">ব্যক্তিগত স্বার্থে রাষ্ট্রীয় সম্পদের অপব্যবহারের এর চেয়ে বড় নজির আর নেই। তবে রিপাবলিকান কনভেনশনের এটিই একমাত্র অভিনব ব্যাপার ছিল না। ট্রাম্প ছাড়াও এই সম্মেলনে ভাষণ দেন তাঁর পরিবারের অধিকাংশ সদস্য। এমনকি তাঁর বড় ছেলে ডোনাল্ড জন ট্রাম্প জুনিয়রের বান্ধবীও ভাষণ দেওয়ার সুযোগ পান। একজন ভাষ্যকারের কথায়</span>,&nbsp;<span lang=\"BN\">এটি ছিল ট্রাম্প কর্তৃক প্রযোজিত ট্রাম্প পরিবারের একটি&nbsp;</span>‘<span lang=\"BN\">রিয়েলিটি শো</span>’<span lang=\"BN\">।</span></span><br></p>','','','','রিপাবলিকান-কনভেনশন-যেন-পারিবারিক-‘রিয়েলিটি-শো’-1598804743','{\"orginal\":\"orginal-15988047432003609811.png\",\"small\":\"small-15988047432003609811.png\",\"medium\":\"medium-15988047432003609811.png\",\"large\":\"large-15988047432003609811.png\"}','1','','','','','','1','2020-08-30 16:25:46','2020-08-30 16:25:46');
INSERT INTO posts VALUES('31','হারিকেন লরা: যুক্তরাষ্ট্রে ১৪ জনের মৃত্যু','<p><span lang=\"BN\" style=\"color: rgb(34, 34, 34); font-variant-ligatures: normal; orphans: 2; text-align: justify; widows: 2; font-size: 14pt; line-height: 21.4667px; font-family: Kalpurush;\">ঘণ্টায় দেড়শ মাইল বেগের ঝড়ো হাওয়া নিয়ে বৃহস্পতিবার লুইজিয়ানার ছোট শহর ক্যামেরনের ওপর দিয়ে চার মাত্রার এ ঘূর্ণিঝড়টি স্থলভাগে উঠে আসে। দক্ষিণাঞ্চলীয় কয়েকটি অঙ্গরাজ্যে লরার তাণ্ডবে প্রায় ৯ লাখ বাড়িঘর ও ব্যবসা প্রতিষ্ঠান বিদ্যুৎবিচ্ছিন্ন হয়ে পড়ে। একটি শিল্প প্ল্যান্টের রাসায়নিকেও আগুন লাগে। বিবিসি জানিয়েছে</span><span style=\"color: rgb(34, 34, 34); font-variant-ligatures: normal; orphans: 2; text-align: justify; widows: 2; font-size: 14pt; line-height: 21.4667px; font-family: Kalpurush;\">,&nbsp;<span lang=\"BN\">পরে শক্তি হারিয়ে ক্রান্তীয় ঝড়ে পরিণত হলেও লরার কারণে এখনও যুক্তরাষ্ট্রের বেশ কয়েকটি অঙ্গরাজ্যে তুমুল বৃষ্টি হচ্ছে। ঝড়ে এখন পর্যন্ত যে ১৪ জনের মৃত্যুর খবর নিশ্চিত হওয়া গেছে</span>,&nbsp;<span lang=\"BN\">তাদের মধ্যে ১০ জনই লুইজিয়ানার। টেক্সাসে মৃত্যু হয়েছে ৪ জনের।</span></span><br></p>','','','','হারিকেন-লরা:-যুক্তরাষ্ট্রে-১৪-জনের-মৃত্যু-1598804817','{\"orginal\":\"orginal-15988048172092378139.jpg\",\"small\":\"small-15988048172092378139.jpg\",\"medium\":\"medium-15988048172092378139.jpg\",\"large\":\"large-15988048172092378139.jpg\"}','1','','','','','','1','2020-08-30 16:26:58','2020-08-30 16:26:58');
INSERT INTO posts VALUES('32','নিউইয়র্কে পবিত্র আশুরা উদযাপন','<p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:
INSERT INTO posts VALUES('33','ব্রঙ্কসে মুসল্লিদের ওপর কৃষ্ণাঙ্গ যুবকের হামলা','<p>বাংলাদেশি অধ্যুষিত নিউইয়র্কের ব্রঙ্কসে মুসল্লীদের উপর এক কৃষ্ণাঙ্গ যুবকের হামলায় কয়েকজন আহত হয়েছেন। ২৮ আগস্ট শুক্রবার জুম্মার নামাজের সময় এই ঘটনা ঘটে। পুলিশ ঘটনাস্থল থেকে যুবকটিকে গ্রেফতার করেছে। প্রত্যক্ষদর্শীরা জানান, নর্থ ব্রঙ্কস ইসলামিক সেন্টরে জুম্মার নামাজের সময় মসজিদের অভ্যন্তরে জায়গা না হওয়ায় মসুল্লীরা ফুটপাত ও রাস্তায় অবস্থান নেন। এ সময় ওই কৃষ্ণাঙ্গ যুবক উত্তেজনাকর কথা বলতে থাকেন এবং মুসল্লিদের উপর মোটরসাইকেল তুলে দেন। এতে কয়েকজন মুসল্লী আহত হন। খবর পেয়ে এনওয়াইপিডি’র বিপুল সংখ্যক পুলিশ এসে যুবকটিকে নিজেদের হেফাজতে নিয়ে যায়।<br></p>','','','','ব্রঙ্কসে-মুসল্লিদের-ওপর-কৃষ্ণাঙ্গ-যুবকের-হামলা-1598813581','{\"orginal\":\"orginal-1598813581334982729.jpg\",\"small\":\"small-1598813581334982729.jpg\",\"medium\":\"medium-1598813581334982729.jpg\",\"large\":\"large-1598813581334982729.jpg\"}','1','','','','','','1','2020-08-30 18:53:02','2020-08-30 18:53:02');
INSERT INTO posts VALUES('34','অভিভাবকদের আস্থা ফেরাতে চ্যান্সেলরের চিঠি','<p>নিউইয়র্কে আগামী ৭ সেপ্টেম্বর স্কুল খুলছে। কিন্তু অভিভাবকরা তাদের সন্তানদের নিয়ে চরম উদ্বেগ আর উৎকণ্ঠায় রয়েছেন। এ অবস্থায় নিউইয়র্ক সিটি ডিপার্টমেন্ট অব এডুকেশনের চ্যান্সেলর রিচার্ড এ কারানজা অভিভাবকদের মধ্যে আস্থা ফিরিয়ে আনার চেষ্টা করছেন। তিনি চিঠি লিখছেন শিক্ষার্থীদের পরিবারের উদ্দেশে।&nbsp;<br></p>','','','','অভিভাবকদের-আস্থা-ফেরাতে-চ্যান্সেলরের-চিঠি-1598813825','{\"orginal\":\"orginal-15988138251365344363.jpg\",\"small\":\"small-15988138251365344363.jpg\",\"medium\":\"medium-15988138251365344363.jpg\",\"large\":\"large-15988138251365344363.jpg\"}','1','','','','','','1','2020-08-30 18:57:08','2020-08-30 18:57:08');
INSERT INTO posts VALUES('35','বাংলাদেশি আমেরিকান লায়ন্স ক্লাবের রক্তদান কর্মসূচি','<p>নিউইয়র্ক বাংলাদেশি আমেরিকান লায়ন ক্লাবের উদ্যোগে রক্তদান কর্মসূচী অনুষ্ঠিত হয়েছে। সংগঠনটির আহ্বানে সাড়া দিয়ে অনেক তরুণ-যুবক স্বেচ্ছায় এই কর্মসূচিতে অংশ নেন। ক্লাবের কর্মকর্তা ছাড়াও অনেক কমিউনিটি নেতা কর্মসূচিতে উপস্থিত ছিলেন।<br></p>','','','','বাংলাদেশি-আমেরিকান-লায়ন্স-ক্লাবের-রক্তদান-কর্মসূচি-1598813892','{\"orginal\":\"orginal-1598813892795460819.jpg\",\"small\":\"small-1598813892795460819.jpg\",\"medium\":\"medium-1598813892795460819.jpg\",\"large\":\"large-1598813892795460819.jpg\"}','1','','','','','','1','2020-08-30 18:58:12','2020-08-30 18:58:12');
INSERT INTO posts VALUES('36','কারবালার মর্মান্তিক ইতিহাস নিয়ে আলোচনা অনুষ্ঠান','<p>কারবালার মর্মান্তিক ইতিহাস নিয়ে ‘ইয়াউমে কারবালা’ নামে বিশেষ ইসলামি আলোচনা অনুষ্ঠান সম্পন্ন করেছে নিউইয়র্কের গাউসিয়া জামে মসজিদ কর্তৃপক্ষ। ২৯ আগস্ট বিকেল সাড়ে ৬টায় অনুষ্ঠিত হওয়া এই অনুষ্ঠানে প্রধান আলোচক ছিলেন গাউসিয়া জামে মসজিদের খতিব আল্লামা জালাল সিদ্দিক।<br></p>','','','','কারবালার-মর্মান্তিক-ইতিহাস-নিয়ে-আলোচনা-অনুষ্ঠান-1598813959','{\"orginal\":\"orginal-15988139591070740303.jpg\",\"small\":\"small-15988139591070740303.jpg\",\"medium\":\"medium-15988139591070740303.jpg\",\"large\":\"large-15988139591070740303.jpg\"}','1','','','','','','1','2020-08-30 18:59:20','2020-08-30 18:59:20');
INSERT INTO posts VALUES('37','নিউইয়র্কের ইসলামিক স্কুল খোলা প্রসঙ্গে ভার্চুয়াল আলোচনা','<p>‘নিউইয়র্কের ইসলামিক স্কুলগুলো কি খোলার জন্য প্রস্তুত?’ এই শিরোনামে ভার্চুয়াল আলোচনা অনুষ্ঠানের আয়োজন করেছে আইটিভি ইউএসএ। আলোচনার মধ্য দিয়ে শিক্ষক, শিক্ষার্থী এবং অভিভাবকদের জন্য অনেক দিক নির্দেশনামূলক বক্তব্য উঠে আসে। আমেরিকান মুসলিম ভয়েস-এর চেয়ারম্যান আবদুল আজিজ ভূইয়ার সঞ্চালনায় অতিথি হিসেবে উপস্থিত ছিলেন রাইজিং স্টারস ইসলামিক স্কুলের চেয়ারম্যান ফাউজিয়া খন্দকার, এমডিকিউ একাডেমির প্রিন্সিপাল আতিয়া পাশা এবং আল মামুর স্কুলের প্রিন্সিপাল আরশিন সাঈদ। &nbsp;<br></p>','','','','নিউইয়র্কের-ইসলামিক-স্কুল-খোলা-প্রসঙ্গে-ভার্চুয়াল-আলোচনা-1598814004','{\"orginal\":\"orginal-1598814004928786139.jpg\",\"small\":\"small-1598814004928786139.jpg\",\"medium\":\"medium-1598814004928786139.jpg\",\"large\":\"large-1598814004928786139.jpg\"}','1','','','','','','1','2020-08-30 19:00:05','2020-08-30 19:00:05');
INSERT INTO posts VALUES('38','ড্রোন হামলার কবলে সৌদি বিমানবন্দর','<p class=\"alignfull\">সৌদি আরবে আবারও ড্রোন হামলা চালিয়েছে হুথি 
INSERT INTO posts VALUES('39','কমলার চেয়ে অনেক বেশি যোগ্য ইভাঙ্কা, দাবি ট্রাম্পের','ডেমোক্র্যাট প্রতিদ্বন্দ্বী জো বাইডেন যাকে ভাইস প্রেসিডেন্ট হিসেবে মনোনীত করেছেন, সেই কমলা হ্যারিসকে ‘অযোগ্য’ বললেন মার্কিন প্রেসিডেন্ট ডোনাল্ড ট্রাম্প। যোগ্যতার নিরিখে কমলার চেয়ে নিজের মেয়ে ইভাঙ্কা অনেক বেশি এগিয়ে বলেও দাবি করেছেন ট্রাম্প। মার্কিন সংবাদমাধ্যম সিএনএন’র এক প্রতিবেদনে বিষয়টি জানা গেছে।<br>শুক্রবার নিউ হ্যাম্পশায়ারে দেওয়া ভাষণে ট্রাম্প জো বাইডেনের বদলে কমলা হ্যারিসকেই লাগাতার আক্রমণ করেছেন।তিনি বলেন, আমিও চাই কোনও নারী প্রেসিডেন্ট নির্বাচিত হোন। কিন্তু উনি (কমলা) যেভাবে প্রেসিডেন্সিয়াল পদ পাওয়ার জন্য এগোচ্ছিলেন, সেভাবে কোনও নারীকে দেখতে চাই না আমি। উনি একেবারেই যোগ্য নন।<p></p><p><br></p><p>ট্রাম্প এই মন্তব্য করার পরেই তার সমর্থকরা ইভাঙ্কার নামে স্লোগান দিতে শুরু করেন। তখন ট্রাম্প বলেন, দেখুন সবাই বলছেন, আমরা ইভাঙ্কাকে চাই। আমি আপনাদের দোষ দিচ্ছি না।<br>কমলাকে আক্রমণ করে ট্রাম্প বলেন, &nbsp;উনার কী যোগ্যতা? সৌন্দর্য? হ্যাঁ উনি সুন্দরী বটে। কিন্তু তারা এমন এক জন নারীকে বেছে নিয়েছে, যিনি প্রেসিডেন্ট পদপ্রার্থী হিসেবে প্রচার তো ভালোভাবেই শুরু করেছিলেন। কিন্তু কয়েক মাসের মধ্যেই তার জনপ্রিয়তা ১৫ থেকে ১২, সেখান থেকে ৯, ৮, ৫, ৩ এবং‌ ২— ক্রমাগত নামতেই থাকে। তাতেই উনি জানিয়ে দেন, আমি সরে যাচ্ছি। এটিই আমার সিদ্ধান্ত। আসলে ভোট পাবেন না জেনেই সরে গিয়েছিলেন। উনি যদি আপনাদের প্রেসিডেন্ট হতেন, ভয়ংকর রকমের খারাপ প্রেসিডেন্ট হতেন।</p><p><br>ট্রাম্প আরও বলেন, জো বাইডেন ও কমলা হ্যারিসকে তুরুপের তাস করে বহিঃশত্রুরা যুক্তরাষ্ট্রকে ধ্বংস করে দেওয়ার চক্রান্ত করছে।</p>','','','','কমলার-চেয়ে-অনেক-বেশি-যোগ্য-ইভাঙ্কা,-দাবি-ট্রাম্পের-1598861474','{\"orginal\":\"orginal-1598861474517172005.png\",\"small\":\"small-1598861474517172005.png\",\"medium\":\"medium-1598861474517172005.png\",\"large\":\"large-1598861474517172005.png\"}','1','1','','','','','1','2020-08-31 08:11:14','2020-08-31 18:25:34');
INSERT INTO posts VALUES('40','গাজায় ইসরায়েলি ট্যাংকের গোলাবর্ষণ','<p>ফিলিস্তিনের গাজায় ট্যাংক থেকে গোলাবর্ষণ চালিয়েছে ইসরায়েলি সেনারা। গাজার সরকার হামাসের অবস্থান লক্ষ্য করে এ হামলা চালানো হয়।</p><p>আলজাজিরা জানায়, গাজা সীমান্ত থেকে ইসরায়েলি এলাকায় বেলুন বোমা ছোড়ার জবাবে রবিবার এ হামলা চালায় ইসরায়েল।</p><p>আগেরদিন দক্ষিণ ইসরায়েলি এলাকায় বিস্ফোরক ভর্তি বেলুন ছোড়া হয়। এর জন্য হামাস দায়ী বলে এক বিবৃতিতে ইসরায়েলি সেনার অভিযোগ।</p><p>তবে গাজায় ইসরায়েলের গোলাবর্ষণে এখন পর্যন্ত কোনো হতাহতের খবর পাওয়া যায়নি।</p><div style=\"text-align:center;margin:5px 0;\">
